import { Link } from 'react-router-dom';
import logo from "../../assets/images/vecteezy_jt-logo-monogram-with-slash-style-design-template_.png";
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-left">
        <div className="logo">
          <img src={logo} alt="logo" />
          <span>Joov Tek</span>
        </div>
        {/* <Link to="/" className="logo" title="Home">Joov Tek</Link> */}
        <Link to="/blogs">Explore</Link>
        <Link to="/create">Write</Link>
      </div>
      <div className="sign">
        <Link to="/signin" className="signin">Sign in</Link>
        <Link to="/singup" className="signup">Sign up</Link>
      </div>
    </nav>
  );
}

export default Navbar;
